const CampaignList = ({ campaigns }) => {
    console.log([campaigns].emailId);
  return (
    <div className="campaign-list">
      {campaigns.map((campaigns) => (
        <div className="campaign-preview" key={campaigns.id}>
          <div className="name-of-ngo">
            <h1>{campaigns.ngoName}</h1>
          </div>
          <div className="mission">
            <h1>{campaigns.objective}</h1>
          </div>
          <div className="target">
            <h1>{campaigns.targetAmount}</h1>
          </div>
          <div className="minimum-donation target">
            <h1>{campaigns.minimumDonation}</h1>
          </div>
          <div className="address target">
            <h1>{campaigns.walletAddress}</h1>
          </div>
          <div className="container">
            <button className="fund-btn center">FUND CAMPAIGN</button>
          </div>
        </div>
      ))}
    </div>
  );
};

export default CampaignList;

